parts:
{
  "name": "UBX-NAV-HPPOSLLH",
  "class_id": "0x01",
  "message_id": "0x14",
  "description": "High precision geodetic position solution",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 36
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U1",
      "name": "version",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 1,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved1",
      "reserved": true,
      "description": "Reserved"
    },
    {
      "byte_offset": 3,
      "data_type": "X1",
      "name": "flags",
      "description": "Additional flags",
      "bit_fields": [
        {
          "bit_offset": 0,
          "name": "invalidLlh",
          "description": "1 = Invalid lon, lat, height, hMSL, lonHp, latHp, heightHp and hMSLHp"
        }
      ]
    },
    {
      "byte_offset": 4,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 8,
      "data_type": "I4",
      "name": "lon",
      "scale": {
        "multiplier": 1e-7,
        "raw": "1e-7"
      },
      "unit": "deg",
      "description": "Longitude"
    },
    {
      "byte_offset": 12,
      "data_type": "I4",
      "name": "lat",
      "scale": {
        "multiplier": 1e-7,
        "raw": "1e-7"
      },
      "unit": "deg",
      "description": "Latitude"
    },
    {
      "byte_offset": 16,
      "data_type": "I4",
      "name": "height",
      "unit": "mm",
      "description": "Height above ellipsoid."
    },
    {
      "byte_offset": 20,
      "data_type": "I4",
      "name": "hMSL",
      "unit": "mm",
      "description": "Height above mean sea level"
    },
    {
      "byte_offset": 24,
      "data_type": "I1",
      "name": "lonHp",
      "scale": {
        "multiplier": 1e-9,
        "raw": "1e-9"
      },
      "unit": "deg",
      "description": "High precision component of longitude. Must be in the range -99..+99. Precise longitude in deg * 1e-7 = lon + (lonHp * 1e-2)."
    },
    {
      "byte_offset": 25,
      "data_type": "I1",
      "name": "latHp",
      "scale": {
        "multiplier": 1e-9,
        "raw": "1e-9"
      },
      "unit": "deg",
      "description": "High precision component of latitude. Must be in the range -99..+99. Precise latitude in deg * 1e-7 = lat + (latHp * 1e-2)."
    },
    {
      "byte_offset": 26,
      "data_type": "I1",
      "name": "heightHp",
      "scale": {
        "multiplier": 0.1,
        "raw": "0.1"
      },
      "unit": "mm",
      "description": "High precision component of height above ellipsoid. Must be in the range -9..+9. Precise height in mm = height + (heightHp * 0.1)."
    },
    {
      "byte_offset": 27,
      "data_type": "I1",
      "name": "hMSLHp",
      "scale": {
        "multiplier": 0.1,
        "raw": "0.1"
      },
      "unit": "mm",
      "description": "High precision component of height above mean sea level. Must be in range -9..+9. Precise height in mm = hMSL + (hMSLHp * 0.1)"
    },
    {
      "byte_offset": 28,
      "data_type": "U4",
      "name": "hAcc",
      "scale": {
        "multiplier": 0.1,
        "raw": "0.1"
      },
      "unit": "mm",
      "description": "Horizontal accuracy estimate"
    },
    {
      "byte_offset": 32,
      "data_type": "U4",
      "name": "vAcc",
      "scale": {
        "multiplier": 0.1,
        "raw": "0.1"
      },
      "unit": "mm",
      "description": "Vertical accuracy estimate"
    }
  ]
}
